INSERT INTO `sys_oper_log` VALUES (243, '通知公告', 2, 'com.rzyk.notice.controller.NoticeController.edit()', 'PUT', 1, 'admin', NULL, '/system/notice/update', 'localhost', '内网IP', '\"<p><br/></p><h2>监考统一板书</h2><h2></h2><ol><li>考试时间</li><li>考试科目</li><li>试卷页数</li><li>大题数</li><li>监考教师</li></ol><h2>诚信标语格式</h2><p>&nbsp;&nbsp;&nbsp;&nbsp;凡考试作弊者一经查实，按违纪情节轻重给予警告、记过、留校察看或开除学籍处分，学士学位授予资格一票否决。</p><h1>监考须知</h1><h4>&nbsp;&nbsp;&nbsp;&nbsp;监考教师必须佩带教务处统一制作的监考证，认真履行监考职责。<br/>&nbsp;&nbsp;&nbsp;&nbsp;学生必须双证齐全（学生证和考试证），缺少任一证件不允许参加考试，一旦查实未带证件参考学生，教务处将追究监考教师责任。</h4>\"', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2022-12-18 00:25:32');
