INSERT INTO `t_exam_tip` VALUES (2, '<h2>监考统一板书</h2><h2></h2><ol><li>考试时间</li><li>考试科目</li><li>试卷页数</li><li>大题数</li><li>监考教师</li></ol><div><h2>诚信标语格式</h2><div><p>&nbsp;&nbsp;&nbsp;&nbsp;凡考试作弊者一经查实，按违纪情节轻重给予警告、记过、留校察看或开除学籍处分，学士学位授予资格一票否决。</p><h2>监考须知</h2><p>&nbsp;&nbsp;&nbsp;&nbsp;监考教师必须佩带教务处统一制作的监考证，认真履行监考职责。</p></div><p>&nbsp;&nbsp;&nbsp;&nbsp;学生必须双证齐全（学生证和考试证），缺少任一证件不允许参加考试，一旦查实未带证件参考学生，教务处将追究监考教师责任。&nbsp;</p></div>', 9);
